import React from 'react';
import Header from '../../components/mobilecare/Header';
import MetricsOverview from '../../components/mobilecare/MetricsOverview';
import ClientList from '../../components/mobilecare/ClientList';
import AIInsights from '../../components/mobilecare/AIInsights';
import MessagingSystem from '../../components/mobilecare/MessagingSystem';

const Dashboard = () => {
  return (
    <div>
      <Header />
      <div className="dashboard-content px-6 py-4">
        <MetricsOverview />
        <ClientList />
        <AIInsights />
        <MessagingSystem />
      </div>
    </div>
  );
};

export default Dashboard;
